import {
    faFacebookF,
    faTwitter,
    faYoutube,
    faInstagram,
    faDiscord
} from '@fortawesome/free-brands-svg-icons';

const fooNavItems = [
    { url: '/', txt: 'EXPLORE SYNERGIES' },
    { url: '/', txt: "CREATOR'S COLLECTIVE" },
    { url: '/', txt: 'ABOUT US' },
    { url: '/', txt: 'PLANET TOTA METAVERSE' },
    { url: '/', txt: 'PLANET TOTA NFTs' },
    { url: '/', txt: "MEET THE `FIRSTs'" },
    { url: '/', txt: "IN PRODUCTION" },
];
const socialItems = [
    { url: '/', icon: faFacebookF },
    { url: '/', icon: faTwitter },
    { url: '/', icon: faYoutube },
    { url: '/', icon: faInstagram },
    { url: '/', icon: faDiscord },
];

export {
    fooNavItems,
    socialItems
};
